import {FETCH_COMPENSATIONS} from "../actions";

const initialState = {
    compensations: []
};

export default function (state = initialState, action) {
    switch (action.type) {
        case FETCH_COMPENSATIONS:
            return {
                compensations: action.payload
            }
    }

    return state;
}
